import { BrowserRouter as Router , Route, Link, Switch ,Redirect} from 'react-router-dom';

import Friends from './Friend/friend.js'
import Create from './Post/create.js'
import Watch from './Watch/watch.js'
import Nottifications from './Nottification/nottifications.js'
import Navbar from './Navbar/navbar.js'
import React from 'react'
import Left from './Home/left.js'
//import Logout from './Logout/Logout.js'
import Messenger from './Messenger/messenger.js'
import Profile from './Profile/userProfile.js';
const routes = [

  {
    path: "/",
    exact:true,
    component: Left
  },
  {
    path: "/userProfile/:username",
    exact:true,
    component: Profile
  },


  {
    path: '/friends',

    component: Friends
  },
  {
    path: '/create',

    component: Create
  },


  {
    path:'/watch',

    component:Watch
  },

  {
    path:'/userProfile/:username',

    component:Profile
  },
  {
    path:'/messenger',

    component:Messenger
  },


  {
    path: '*',
    render: () => <Redirect to="/" />
  }
];
export default function(props) {

  return (
        <div >
         <Router>
        <Navbar />

          <Switch>
            {routes.map((route, index) => (
            <Route key={index} {...route} />
            )
            )}
          </Switch>
       </Router>
        </div>
      );
}
